export default function Popup({ display, text, img1, img2 }) {
  return (
    <div className={"popup " + display ? "" : "hidden"}>
      <button onClick={clickHandler}>Close</button>
      <p>{text}</p>
      <img src={img1} />
      <img src={img2} />
    </div>
  );
}
